window.bookSummaryJSON = "<p><b>Jeb Trapper tried to kill himself. The gun jammed.</b></p> <p>Two months later, the vet is now participating in underground trials of ecstasy to treat his PTSD. Everything seems to be going great until:</p> <p><i>&gt;&gt;&gt;The System Has Been Installed&lt;&lt;&lt;</i></p> <p>Jeb is teleported into a tutorial, along with everyone else on Earth. Now, he has to choose the level of difficulty. There's just one problem: He's high as a kite, and nothing seems impossible.</p>"; 
